import React from "react";
import { withStyles } from "@material-ui/core/styles";
import styles from "./styles/CustomLessonEventStyles";

const CustomLessonEvent = ({ event, styles }) => {
  const { classes } = styles;
  return (
    <div className={classes.style}>
      <div>{event.title}</div>
      <span style={{ fontWeight: "600" }}>{event.room}</span>
    </div>
  );
};
export default withStyles(styles)(CustomLessonEvent);
